import React from "react";

import { makeStyles, Typography } from "@material-ui/core";

export const ContactDetail = ({ contactId }) => {
  return (
    <>
      {contactId ? (
        <Typography align="center" variant="h3">
          Contact Info
        </Typography>
      ) : (
        <Typography align="center" variant="h4">
          Select a contact
        </Typography>
      )}
    </>
  );
};
